/// <summary>
/// Enables or disables the packing slip correction and cancel actions.
/// </summary>
public void enableCancelAndCorrectionActions()
{
    boolean isCancelEnabled, isCorrectionEnabled;

    [isCancelEnabled, isCorrectionEnabled] =
        VendPackingSlipJourFormHelper::canPackingSlipBeCanceledOrCorrected(vendPackingSlipJour);

    purchFormLetter_PackingSlipCancel.enabled(isCancelEnabled);
    purchFormLetter_PackingSlip.enabled(isCorrectionEnabled);
}

