        lines.activatePage();
        vendPackingSlipTrans_ds.positionToRecord(element.args().record());
    }
}

void updateDesign(InventDimFormDesignUpdate mode)
{
    PurchLine       purchLine;

    InventMovement  movement = InventMovement::construct(purchLine);

    switch (mode)
    {
        case InventDimFormDesignUpdate::Init        :
            if (!inventDimFormSetup)
            {
                inventDimFormSetup  = InventDimCtrl_Frm_Mov::newFromFormMovement(element, movement);
            }

        case InventDimFormDesignUpdate::Active      :
            inventDimFormSetup.formActiveSetup(movement.inventDimGroupSetup(), movement);
            inventDimFormSetup.formSetControls(true);
            break;

        case InventDimFormDesignUpdate::FieldChange :
            inventDimFormSetup.formActiveSetup(movement.inventDimGroupSetup(), movement);
            inventDimFormSetup.formSetControls(false);
            break;

        default : throw error(strFmt("@SYS54195",funcName()));
    }
}

public void init()
{
    super();

    QueryBuildDataSource    queryDataSourceLink;
    CustPackingSlipJour     custPackingSlipJour;
    CustPackingSlipTrans    custPackingSlipTrans;

    switch (element.args().dataset())
    {
        case tableNum(PurchTable) :
            this.query().dataSourceTable(tableNum(VendPackingSlipJour)).clearDynalinks();

            queryDataSourceLink = this.query().dataSourceTable(tableNum(VendPackingSlipJour)).addDataSource(tableNum(VendPackingSlipPurchLink));
            queryDataSourceLink.relations(true);
            queryDataSourceLink.addDynalink(fieldNum(VendPackingSlipPurchLink, OrigPurchId),
                                            element.args().record(),
                                            fieldNum(PurchTable, PurchId));
            // <GEERU>
            queryDataSourceLink.joinMode(JoinMode::ExistsJoin);
            // </GEERU>
            break;

        case tableNum(CustPackingSlipJour) :
            custPackingSlipJour = element.args().record() as CustPackingSlipJour;
            queryDataSourceLink = this.query().dataSourceTable(tableNum(VendPackingSlipJour)).addDataSource(tableNum(TradePackingSlipJourChain));
            queryDataSourceLink.relations(true);
            queryDataSourceLink.joinMode(JoinMode::ExistsJoin);
            queryDataSourceLink.addRange(fieldNum(TradePackingSlipJourChain, CustPackingSlipJour)).value(queryValue(custPackingSlipJour.RecId));
            break;

        case tableNum(CustPackingSlipTrans) :
            custPackingSlipTrans = element.args().record() as CustPackingSlipTrans;
            custPackingSlipJour = custPackingSlipTrans.custPackingslipJour();
            queryDataSourceLink = this.query().dataSourceTable(tableNum(VendPackingSlipJour)).addDataSource(tableNum(TradePackingSlipJourChain));
            queryDataSourceLink.relations(true);
            queryDataSourceLink.joinMode(JoinMode::ExistsJoin);
            queryDataSourceLink.addRange(fieldNum(TradePackingSlipJourChain, CustPackingSlipJour)).value(queryValue(custPackingSlipJour.RecId));
    }
    // <GIN>
    if (TaxParameters::checkTaxParameters_IN() &&
        isConfigurationkeyEnabled(configurationkeynum(LedgerBasic)) &&
        VendParameters::find().MatchedPackingSlipsInquiry &&
        element.args().dataset() == tablenum(VendInvoiceJour))
    {
        this.query().dataSourceTable(tablenum(VendPackingSlipJour)).clearDynalinks();

        queryDataSourceLink = this.query().dataSourceTable(tablenum(VendPackingSlipJour)).addDataSource(tablenum(VendPackingSlipPurchLink));
        queryDataSourceLink.relations(true);
        queryDataSourceLink.addDynalink(fieldnum(VendPackingSlipPurchLink, OrigPurchId),
                                        element.args().record(),
                                        fieldnum(VendInvoiceJour, PurchId));
    }
    // </GIN>

    if (element.args().dataset() == tableNum(VendPackingSlipJour) &&
        element.args().record().RecId)
    {
        queryDataSourceLink = this.query().dataSourceTable(tableNum(VendPackingSlipJour));
        queryDataSourceLink.addDynalink(fieldNum(VendPackingSlipJour, RecId),
                                        element.args().record(),
                                        fieldNum(VendPackingSlipJour, RecId));
    }
}

