void clicked()
{
    if (VendPackingSlipJourCheckPOConfirmationOnClickFlight::instance().isEnabled())
    {
        if (!vendPackingSlipJour.purchTable().isDocumentConfirmed())
        {
            throw error(strFmt("@SCM:PONotConfirmed", VendPackingSlipJour.purchTable().PurchId));
        }
    }

    if (vendPackingSlipJour.existsPendingVendorInvoice())
    {
        throw error("@SYP4986046");
    }

    if (vendPackingSlipJour.hasItemReq())
    {
        throw error(strfmt("@SCM:CannotCorrectProductReceiptThatHasLinkedItemRequirements", vendPackingSlipJour.PackingSlipId));
    }

    if (TaxIntegrationHelper::hasPhysicalTaxPosted_IN(vendPackingSlipJour))
    {
        throw error("@TaxGST:NotPossibleToCorrectProductReceipt");
    }

    InventQualityOrderTable inventQualityOrderTable = vendPackingSlipJour.openQualityOrder();

    if (inventQualityOrderTable)
    {
        error(strFmt("@SYP4881938", inventQualityOrderTable.QualityOrderId),
              '',
              SysInfoAction_TableField::newBuffer(inventQualityOrderTable));
    }
    else
    {
        VendPackingSlipJourFormHelper::checkCanProcessPackSlipCorrection(vendPackingSlipJour);
        super();
    }

    refreshCaller = true;
}

void clicked()
{
    #ISOCountryRegionCodes

    if (VendPackingSlipJourCheckPOConfirmationOnClickFlight::instance().isEnabled())
    {
        if (!vendPackingSlipJour.purchTable().isDocumentConfirmed())
        {
            throw error(strFmt("@SCM:PONotConfirmed", VendPackingSlipJour.purchTable().PurchId));
        }
    }

    VendPackingSlipJour localVendPackingSlipJour = vendPackingSlipJour.data();
    PurchTable          purchTable;

    if (localVendPackingSlipJour.existsPendingVendorInvoice())
    {
        throw error("@SYP4986046");
    }

    if (
        SysCountryRegionCode::isLegalEntityInCountryRegion([#isoRU]) ||
        Box::yesNo("@SYS342632", DialogButton::No) == DialogButton::Yes
    )
    {
        boolean prodReceiptLinkedToIR = localVendPackingSlipJour.hasItemReq();
        if (!projCancelPOReceiptWithItemRequirementFeatureEnabled
            && prodReceiptLinkedToIR)
        {
            throw error(strfmt("@SCM:ProductReceiptHasLinkedItemRequirements", localVendPackingSlipJour.PackingSlipId));
        }
        else if (projCancelPOReceiptWithItemRequirementFeatureEnabled && prodReceiptLinkedToIR)
        {
            VendPackingSlipTrans localVendPackingSlipTrans;
            select count(RecId) from localVendPackingSlipTrans
                where localVendPackingSlipTrans.PackingSlipId == localVendPackingSlipJour.PackingSlipId;

            ProjOpsManagementLogger logger = ProjOpsManagementLogger::createLogger(formStr(VendPackingSlipJournal));
            using (var activityContext = logger.projOpsManagementActivity().projPOProdReceiptCancellationContext())
            {
                logger.logInformation(strFmt("User attempted to cancel product receipt RecId:%1 linked to item requirement with %2 lines", localVendPackingSlipJour.RecId, localVendPackingSlipTrans.RecId));
            }
        }

        refreshCaller = true;
        super();


        if (localVendPackingSlipJour.isCanceled())
        {
            info(strFmt("@SYS343994", localVendPackingSlipJour.PackingSlipId));
        }
        else
        {
            purchTable = vendPackingSlipJour.data().purchTable();
            if (purchTable.DocumentState != VersioningDocumentState::Confirmed && purchTable.ChangeRequestRequired == NoYes::Yes)
            {
                error("@SCM:ProductReceiptCancellationNotApprovedPO");
            }
        }
    }
}
